import React, {Component} from 'react'
import StyledTableRow from '@material-ui/core/TableRow'
import StyledTableCell from '@material-ui/core/TableCell'
import Button from '@material-ui/core/Button'

import ParentModalFlow from './parentsModal'

class TableItem extends Component{

    state = {
        name: this.props.name,
        type: this.props.type,
        plateNumber: this.props.plateNumber,
        showParentEdit: false,
        showParentDeactivate: false
    }

    handleEditModal = (e) => {
        console.log("Edit Modal")
        this.setState({showParentEdit: true})
    }   

    handleDeleteModal = (e) => {
        console.log("Delete Modal")
        this.setState({showParentDeactivate: true})
    }   

    onCancel = () => {
        this.setState({showParentEdit: false, showParentDeactivate: false})
    }

    render(){
        return(
            <StyledTableRow key={this.props.i}>
              <StyledTableCell component="th" scope="row">
                {this.state.name}
              </StyledTableCell>
                <StyledTableCell align="left">{this.state.type}</StyledTableCell>
              <StyledTableCell align="left">{this.state.plateNumber}</StyledTableCell>
              <StyledTableCell align="right">{[<Button id="123" onClick={(e) => {this.handleEditModal(e)}}>Edit</Button>,<Button onClick={(e)=>{this.handleDeleteModal(e)}}>Delete</Button>]}</StyledTableCell>
              <ParentModalFlow showEditModal={this.state.showParentEdit} onCancel={this.onCancel} showDeactivateModal={this.state.showParentDeactivate}/>
            </StyledTableRow>
        )
    }

}

export default TableItem
